import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter } from 'react-router-dom';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter basename="/recanti">
      <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
